import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { OrderService } from '../orderadmins.service';
import { Order } from '../../models/order';
import { CommonModule } from '@angular/common';
import { MatCard, MatCardTitle, MatCardHeader, MatCardModule } from '@angular/material/card';
import { MatListModule } from '@angular/material/list';
import { MatIcon } from '@angular/material/icon';
import { OrderItem } from '../../models/order-item';
import { FormsModule } from '@angular/forms';

@Component({
  selector: 'app-order-details',
  standalone: true,
  imports: [FormsModule,CommonModule, MatCard, MatCardTitle, MatCardModule, MatListModule,MatIcon],
  templateUrl: './order-details.component.html',
  styleUrls: ['./order-details.component.scss']
})
export class OrderDetailsComponent implements OnInit {
  orderId!: number;
  order?: Order;
  searchText: string = '';
  filteredItems?: OrderItem[] = [];
  constructor(private route: ActivatedRoute, private orderService: OrderService) { }

  ngOnInit(): void {
    this.orderId = Number(this.route.snapshot.paramMap.get('id'));
    this.fetchOrderDetails();
  }
  filterItems(): void {
    if (this.order && this.order.orderItems) {
      this.filteredItems = this.order.orderItems.filter(item =>
        item.food.name.toLowerCase().includes(this.searchText.toLowerCase())
      );
    }
  }
  fetchOrderDetails(): void {
    this.orderService.getOrderById(this.orderId).subscribe(
      (data) => {
        this.order = data;
        this.filteredItems =this.order.orderItems; 
      },
      (error) => {
        console.error('Error fetching order details:', error);
      }
    );
  }
}
<mat-card class="cardWithShadow theme-card custom-card">
  <mat-card-header class="custom-card-header">
    <mat-card-title class="m-b-0">Order details</mat-card-title>
  </mat-card-header>
  <mat-card-content class="b-t-1 custom-card-content">
    <div class="row">
      <div class="col-lg-6">
        <div class="mb-4">
          <input
            type="text"
            placeholder="Search Items..."
            class="w-full p-2 border border-gray-300 rounded-lg"
            [(ngModel)]="searchText"
            (ngModelChange)="filterItems()"
          />
        </div>
        <mat-card class="b-1 shadow-none inner-card" style="border-radius: 5px;">
          <mat-card-header class="custom-card-header" style="border-radius: 5px;">
            <mat-card-title>Number: {{ order?.id }}</mat-card-title>
          </mat-card-header>
          <mat-card-content class="b-t-1">
            <mat-list role="list" *ngIf="order">
              <mat-list-item role="listitem"><strong>Client Name:</strong> {{ order?.client?.firstname }} {{order?.client?.lastname}} </mat-list-item>
              <mat-list-item role="listitem"><strong>Client Email:</strong> {{ order?.client?.email }}</mat-list-item>
              <mat-list-item role="listitem"><strong>Date:</strong> {{ order?.orderDate }}</mat-list-item>
              <mat-list-item role="listitem"><strong>Status:</strong> {{ order?.status }}</mat-list-item>
              <mat-list-item role="listitem"><strong>Comment:</strong> {{ order?.comment }}</mat-list-item>
              <mat-list-item role="listitem"><strong>Total:</strong> {{ order?.total }}</mat-list-item>
              <p></p>
              <mat-list-item role="listitem"><strong>Items:</strong>
                <ul>
                  <li *ngFor="let item of filteredItems">
                    {{ item.food?.name }} - Quantity: {{ item.quantity }}
                  </li>
                </ul>
              </mat-list-item>
            </mat-list>
          </mat-card-content>
        </mat-card>
      </div>
    </div>
  </mat-card-content>
</mat-card>
